import React, { useEffect, useState } from "react";
import Box from "@mui/material/Box";
import { DataGrid, GridColDef } from "@mui/x-data-grid";
import { MY_BU_ID, BASE_API_URL, GET_DEFAULT_HEADERS } from "../globals";
import { IStudentDetail } from "../types/api_types";

interface TestProps {
  studentDetails: IStudentDetail[];
  classTitleId: string[];
}

const columns: GridColDef[] = [
  {
    field: "studentID",
    headerName: "Student ID",
  },
  {
    field: "studentName",
    headerName: "Student Name",
    width: 150,
  },
  {
    field: "classID",
    headerName: "Class ID",
  },
  {
    field: "className",
    headerName: "Class Name",
  },
  {
    field: "semester",
    headerName: "Semester",
  },
  {
    field: "finalGrade",
    headerName: "Final Grade",
  },
];

export const Test = ({ studentDetails,classTitleId }: TestProps) => {
  console.log("studentDetails:", studentDetails);
  const classTitle = classTitleId[0];
  const classId = classTitleId[1];
  const rows = studentDetails.map((student, index) => ({
    id: index,
    studentID: student.universityId,
    studentName: student.name,
    classID: classId,
    className: classTitle,
    semester: "fall2022", // Replace this with actual semester if available
    finalGrade: "Unknown", // Replace this with actual grade if available
  }));
  return (
    <Box sx={{ height: 400, width: "100%" }}>
      <DataGrid
        rows={rows}
        columns={columns}
        pageSize={5}
      />
    </Box>
  );
};
